interface PTS {
    /**
     * 保存或修改场景。
     */
    SavePtsScene(query: SavePtsSceneRequest): Promise<SavePtsSceneResponse>;
    /**
     * 创建压测场景。
     */
    CreatePtsScene(query: CreatePtsSceneRequest): Promise<CreatePtsSceneResponse>;
    /**
     * 删除场景，一次删除一个。
     */
    DeletePtsScene(query: DeletePtsSceneRequest): Promise<DeletePtsSceneResponse>;
    /**
     * 一次批量删除多个场景。
     */
    DeletePtsScenes(query: DeletePtsScenesRequest): Promise<DeletePtsScenesResponse>;
    /**
     * 查询场景的结构、施压等信息。
     */
    GetPtsScene(query: GetPtsSceneRequest): Promise<GetPtsSceneResponse>;
    /**
     * 分页查询场景概览信息。
     */
    ListPtsScene(query: ListPtsSceneRequest): Promise<ListPtsSceneResponse>;
    /**
     * 修改场景配置信息，比如URL、施压信息。
     */
    ModifyPtsScene(query: ModifyPtsSceneRequest): Promise<ModifyPtsSceneResponse>;
    /**
     * 启动场景入参为场景ID。
     */
    StartPtsScene(query: StartPtsSceneRequest): Promise<StartPtsSceneResponse>;
    /**
     * 停止场景入参为场景ID。
     */
    StopPtsScene(query: StopPtsSceneRequest): Promise<StopPtsSceneResponse>;
    /**
     * 启动场景的调试，了解配置信息是否通。
     */
    StartDebugPtsScene(query: StartDebugPtsSceneRequest): Promise<StartDebugPtsSceneResponse>;
    /**
     * 停止正在调试中的场景。
     */
    StopDebugPtsScene(query: StopDebugPtsSceneRequest): Promise<StopDebugPtsSceneResponse>;
    /**
     * 场景压测或调试中获取场景的运行时数据。
     */
    GetPtsSceneRunningData(query: GetPtsSceneRunningDataRequest): Promise<GetPtsSceneRunningDataResponse>;
    /**
     * 场景启动压测后，获取运行时状态。
     */
    GetPtsSceneRunningStatus(query: GetPtsSceneRunningStatusRequest): Promise<GetPtsSceneRunningStatusResponse>;
    /**
     * 场景压测产生多个场景，可批量查询关联的所有报告。
     */
    GetPtsReportsBySceneId(query: GetPtsReportsBySceneIdRequest): Promise<GetPtsReportsBySceneIdResponse>;
    /**
     * 获取场景压测后的报告详情。
     */
    GetPtsReportDetails(query: GetPtsReportDetailsRequest): Promise<GetPtsReportDetailsResponse>;
    /**
     * 将一个报告数据设置为场景基线。
     */
    CreatePtsSceneBaseLineFromReport(query: CreatePtsSceneBaseLineFromReportRequest): Promise<CreatePtsSceneBaseLineFromReportResponse>;
    /**
     * 删除场景设置的基线信息。
     */
    DeletePtsSceneBaseLine(query: DeletePtsSceneBaseLineRequest): Promise<DeletePtsSceneBaseLineResponse>;
    /**
     * 更新一个场景的基线数据。
     */
    UpdatePtsSceneBaseLine(query: UpdatePtsSceneBaseLineRequest): Promise<UpdatePtsSceneBaseLineResponse>;
    /**
     * 查询场景设置的基线数据。
     */
    GetPtsSceneBaseLine(query: GetPtsSceneBaseLineRequest): Promise<GetPtsSceneBaseLineResponse>;
    /**
     * 根据条件列出JMeter环境。
     */
    ListEnvs(query: ListEnvsRequest): Promise<ListEnvsResponse>;
    /**
     * 新建或更新JMeter环境。
     */
    SaveEnv(query: SaveEnvRequest): Promise<SaveEnvResponse>;
    /**
     * 根据JMeter环境ID移除JMeter环境。
     */
    RemoveEnv(query: RemoveEnvRequest): Promise<RemoveEnvResponse>;
    /**
     * 获得JMeter场景详情。
     */
    GetOpenJMeterScene(query: GetOpenJMeterSceneRequest): Promise<GetOpenJMeterSceneResponse>;
    /**
     * 新建或更新JMeter场景。
     */
    SaveOpenJMeterScene(query: SaveOpenJMeterSceneRequest): Promise<SaveOpenJMeterSceneResponse>;
    /**
     * 根据条件获得JMeter场景列表。
     */
    ListOpenJMeterScenes(query: ListOpenJMeterScenesRequest): Promise<ListOpenJMeterScenesResponse>;
    /**
     * 移除JMeter场景。
     */
    RemoveOpenJMeterScene(query: RemoveOpenJMeterSceneRequest): Promise<RemoveOpenJMeterSceneResponse>;
    /**
     * 开始压测JMeter场景。
     */
    StartTestingJMeterScene(query: StartTestingJMeterSceneRequest): Promise<StartTestingJMeterSceneResponse>;
    /**
     * 停止JMeter场景压测。
     */
    StopTestingJMeterScene(query: StopTestingJMeterSceneRequest): Promise<StopTestingJMeterSceneResponse>;
    /**
     * 开始调试JMeter场景。
     */
    StartDebuggingJMeterScene(query: StartDebuggingJMeterSceneRequest): Promise<StartDebuggingJMeterSceneResponse>;
    /**
     * 停止JMeter场景调试。
     */
    StopDebuggingJMeterScene(query: StopDebuggingJMeterSceneRequest): Promise<StopDebuggingJMeterSceneResponse>;
    /**
     * 根据场景ID获取JMeter场景压测过程中的数据。
     */
    GetJMeterSceneRunningData(query: GetJMeterSceneRunningDataRequest): Promise<GetJMeterSceneRunningDataResponse>;
    /**
     * 根据条件获得JMeter采样器聚合数据。
     */
    GetJMeterSampleMetrics(query: GetJMeterSampleMetricsRequest): Promise<GetJMeterSampleMetricsResponse>;
    /**
     * 根据条件获得JMeter采样器的采样日志。
     */
    GetJMeterSamplingLogs(query: GetJMeterSamplingLogsRequest): Promise<GetJMeterSamplingLogsResponse>;
    /**
     * 获得JMeter运行日志。默认查询第0台机器的日志，并返回机器总数。
     */
    GetJMeterLogs(query: GetJMeterLogsRequest): Promise<GetJMeterLogsResponse>;
    /**
     * 根据条件列出JMeter报告的概要信息。
     */
    ListJMeterReports(query: ListJMeterReportsRequest): Promise<ListJMeterReportsResponse>;
    /**
     * 调整jmeter压力大小
     */
    AdjustJMeterSceneSpeed(query: AdjustJMeterSceneSpeedRequest): Promise<AdjustJMeterSceneSpeedResponse>;
    GetUserVpcSecurityGroup(query: GetUserVpcSecurityGroupRequest): Promise<GetUserVpcSecurityGroupResponse>;
    GetUserVpcVSwitch(query: GetUserVpcVSwitchRequest): Promise<GetUserVpcVSwitchResponse>;
    /**
     * 获取所有的region
     */
    GetAllRegions(query: GetAllRegionsRequest): Promise<GetAllRegionsResponse>;
    GetUserVpcs(query: GetUserVpcsRequest): Promise<GetUserVpcsResponse>;
    /**
     * 调整PTS场景压力值。
     */
    AdjustPtsSceneSpeed(query: AdjustPtsSceneSpeedRequest): Promise<AdjustPtsSceneSpeedResponse>;
    /**
     * 查询PTS场景调试任务的采样日志。
     */
    GetPtsDebugSampleLogs(query: GetPtsDebugSampleLogsRequest): Promise<GetPtsDebugSampleLogsResponse>;
    /**
     * 根据条件列出PTS报告的概要信息。
     */
    ListPtsReports(query: ListPtsReportsRequest): Promise<ListPtsReportsResponse>;
    /**
     * 查询JMeter报告详情。
     */
    GetJMeterReportDetails(query: GetJMeterReportDetailsRequest): Promise<GetJMeterReportDetailsResponse>;
}
export default PTS;
